const Display = (props) => {
  return (
    <div>
      <h1>
        {props.countryName}
      </h1>
      <div>
        capital {props.capital}\n area {props.area}
      </div>
      <div>
        <h2>
          languages:

        </h2>
        <ul>
          {props.languages.map(language => <li>{language}</li>)}
        </ul>

      </div>
    </div>

  )
}

export default Display
